import { useEffect, useState } from 'react';
import axios from 'axios';

function RealTime() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/fleet/realtime')
      .then(res => setData(res.data));
  }, []);

  return (
    <div>
      <h2>Real-Time Data</h2>
      {data.map((d, i) => (
        <div key={i}>
          <p>Route: {d.route.sourceCity} → {d.route.destinationCity}</p>
          <p>Vehicle: {d.vehicle.registrationNumber}</p>
          <p>Speed: {d.averageSpeedKmph.toFixed(1)} km/h</p>
          <p>Total Cost: ₹{d.totalCost.toFixed(2)}</p>
        </div>
      ))}
    </div>
  );
}
export default RealTime;
